import React from 'react';
import styled from 'styled-components';
import HomeCard from './HomeCard'; // Assurez-vous que le chemin est correct

const Wrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  gap: 20px;
  padding: 50px;
`;

const CardsWrapper = ({ setBackgroundColor }) => {
  return (
    <Wrapper>
      <HomeCard
        image="/path-to-image/junebaby.png" // Remplacez par le chemin correct
        rotate="-5deg"
        onMouseEnter={() => setBackgroundColor('#FFD700')}
        onMouseLeave={() => setBackgroundColor('#8B2514')}
      >
        {/* Vous pouvez ajouter du texte ou d'autres éléments ici */}
      </HomeCard>
      <HomeCard
        image=".//yourself.png" // Remplacez par le chemin correct
        rotate="0deg"
        onMouseEnter={() => setBackgroundColor('#FF69B4')}
        onMouseLeave={() => setBackgroundColor('#8B2514')}
      >
        {/* Vous pouvez ajouter du texte ou d'autres éléments ici */}
      </HomeCard>
      <HomeCard
        image="/path-to-image/love.png" // Remplacez par le chemin correct
        rotate="5deg"
        onMouseEnter={() => setBackgroundColor('#FF4500')}
        onMouseLeave={() => setBackgroundColor('#8B2514')}
      >
        {/* Vous pouvez ajouter du texte ou d'autres éléments ici */}
      </HomeCard>
    </Wrapper>
  );
};

export default CardsWrapper;
